import React from 'react';
import { Routes} from 'react-router-dom';

import RouteHandler from './components/RouteHandler'

import Home from './pages/Home';
import About from './pages/About';
import NotFound from './pages/NotFound';
import SignIn from './pages/SignIn';
import SignUp from './pages/SignUp';
import AdPage from './pages/AdPage';
import AddAd from './pages/AddAd';

export default () => {
    return (
        <Routes>
            <RouteHandler path="/" element={<Home />}/>

            <RouteHandler exact path="/about" element={<About />}/>


            <RouteHandler exact path="/signin" element={<SignIn />}/>


            <RouteHandler exact path="/signup" element={<SignUp />}/>


            <RouteHandler exact path="/ad/:id" element={<AdPage />}/>


            <RouteHandler private exact path="/post-an-ad" element={<AddAd />}/>


            <RouteHandler element={<NotFound />}/>


        </Routes>
    );
}
